import React from 'react';

const Stats = () => {
  const geographicalFootprint = [
    { number: "4", label: "South West", details: "Lagos, Ogun, Oyo, Ondo" },
    { number: "1", label: "North Central", details: "Abuja (FCT)" },
    { number: "1", label: "South East", details: "Imo" },
    { number: "2", label: "North West", details: "Kano, Jigawa" },
    { number: "1", label: "North East", details: "Adamawa" }
  ];

  return (
    <div className="container-fluid gtco-numbers-block">
      <div className="container" style={{position: 'relative', paddingTop: '80px', paddingBottom: '80px', minHeight: '500px'}}>
        {/* Nigeria Map Background */}
        <div style={{
          position: 'absolute',
          top: '50%',
          left: '50%',
          transform: 'translate(-50%, -50%)',
          width: '90%',
          maxWidth: '700px',
          opacity: 0.25,
          zIndex: 0
        }}>
          <img 
            src="images/nigerian-map.svg" 
            alt="Nigeria Map" 
            style={{
              width: '100%',
              height: 'auto',
              filter: 'sepia(100%) saturate(300%) hue-rotate(70deg)'
            }}
          />
        </div>
        
        {/* Regional Numbers and Labels positioned on the map */}
        <div style={{position: 'relative', zIndex: 1, height: '400px'}}>
          {/* South West - Bottom Left */}
          <div style={{
            position: 'absolute',
            left: '20%',
            top: '65%',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '3rem',
              fontWeight: 'bold',
              color: '#2d5016',
              textShadow: '2px 2px 4px rgba(255,255,255,0.8)'
            }}>4</div>
            <div style={{
              fontSize: '1rem',
              fontWeight: '600',
              color: '#4a7c59',
              marginTop: '-10px'
            }}>South West</div>
            <div style={{
              fontSize: '0.75rem',
              color: '#6b9b37',
              marginTop: '2px'
            }}>Lagos, Ogun, Oyo, Ondo</div>
          </div>

          {/* North Central - Center */}
          <div style={{
            position: 'absolute',
            left: '50%',
            top: '45%',
            transform: 'translateX(-50%)',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '3rem',
              fontWeight: 'bold',
              color: '#2d5016',
              textShadow: '2px 2px 4px rgba(255,255,255,0.8)'
            }}>1</div>
            <div style={{
              fontSize: '1rem',
              fontWeight: '600',
              color: '#4a7c59',
              marginTop: '-10px'
            }}>North Central</div>
            <div style={{
              fontSize: '0.75rem',
              color: '#6b9b37',
              marginTop: '2px'
            }}>Abuja (FCT)</div>
          </div>

          {/* South East - Bottom Right */}
          <div style={{
            position: 'absolute',
            right: '25%',
            top: '65%',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '3rem',
              fontWeight: 'bold',
              color: '#2d5016',
              textShadow: '2px 2px 4px rgba(255,255,255,0.8)'
            }}>1</div>
            <div style={{
              fontSize: '1rem',
              fontWeight: '600',
              color: '#4a7c59',
              marginTop: '-10px'
            }}>South East</div>
            <div style={{
              fontSize: '0.75rem',
              color: '#6b9b37',
              marginTop: '2px'
            }}>Imo</div>
          </div>

          {/* North West - Top Left */}
          <div style={{
            position: 'absolute',
            left: '25%',
            top: '20%',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '3rem',
              fontWeight: 'bold',
              color: '#2d5016',
              textShadow: '2px 2px 4px rgba(255,255,255,0.8)'
            }}>2</div>
            <div style={{
              fontSize: '1rem',
              fontWeight: '600',
              color: '#4a7c59',
              marginTop: '-10px'
            }}>North West</div>
            <div style={{
              fontSize: '0.75rem',
              color: '#6b9b37',
              marginTop: '2px'
            }}>Kano, Jigawa</div>
          </div>

          {/* North East - Top Right */}
          <div style={{
            position: 'absolute',
            right: '20%',
            top: '25%',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '3rem',
              fontWeight: 'bold',
              color: '#2d5016',
              textShadow: '2px 2px 4px rgba(255,255,255,0.8)'
            }}>1</div>
            <div style={{
              fontSize: '1rem',
              fontWeight: '600',
              color: '#4a7c59',
              marginTop: '-10px'
            }}>North East</div>
            <div style={{
              fontSize: '0.75rem',
              color: '#6b9b37',
              marginTop: '2px'
            }}>Adamawa</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Stats;
